//----------------------------------------------------------------------------
//Safe maths
//----------------------------------------------------------------------------
library SafeMath {
 function add(uint a, uint b) internal pure returns (uint c) {
     c = a + b;
     require(c >= a);
 }
 function sub(uint a, uint b) internal pure returns (uint c) {
     require(b <= a);
     c = a - b;
 }
 function mul(uint a, uint b) internal pure returns (uint c) {
     c = a * b;
     require(a == 0 || c / a == b);
 }
 function div(uint a, uint b) internal pure returns (uint c) {
     require(b > 0);
     c = a / b;
 }
}


//----------------------------------------------------------------------------
//ERC Token Standard #20 Interface
//https://github.com/ethereum/EIPs/blob/master/EIPS/eip-20.md
//----------------------------------------------------------------------------
abstract contract ERC20Interface {
 function totalSupply() public virtual view returns (uint);
 function balanceOf(address tokenOwner) public virtual view returns (uint balance);
 function allowance(address tokenOwner, address spender) public virtual view returns (uint remaining);
 function transfer(address to, uint tokens) public virtual returns (bool success);
 function approve(address spender, uint tokens) public virtual returns (bool success);
 function transferFrom(address from, address to, uint tokens) public virtual returns (bool success);

 event Transfer(address indexed from, address indexed to, uint tokens);
 event Approval(address indexed tokenOwner, address indexed spender, uint tokens);
}


//----------------------------------------------------------------------------
//Contract function to receive approval and execute function in one call
//
//Borrowed from MiniMeToken
//----------------------------------------------------------------------------
abstract contract ApproveAndCallFallBack {
 function receiveApproval(address from, uint256 tokens, address token, bytes memory data) public virtual;
}


//----------------------------------------------------------------------------
//Owned contract
//----------------------------------------------------------------------------
contract Owned {
 address payable internal owner;
 address payable private newOwner;

 event OwnershipTransferred(address payable indexed _from, address payable indexed _to);

 constructor() public {
     owner = msg.sender;
 }

 modifier onlyOwner {
     require(msg.sender == owner);
     _;
 }

 function transferOwnership(address payable _newOwner) public onlyOwner {
     newOwner = _newOwner;
 }
 function acceptOwnership() public {
     require(msg.sender == newOwner);
     emit OwnershipTransferred(owner, newOwner);
     owner = newOwner;
     newOwner = address(0);
 }
}



//----------------------------------------------------------------------------
//ERC20 Token, with the addition of symbol, name and decimals and a
//Hujo
//----------------------------------------------------------------------------
contract HujoCoin is ERC20Interface, Owned {
	using SafeMath for uint;

	//TODO try shorten names to see effects on size

	string public symbol;
    string public name;
    bool public mintable; //TODO combine with other booleans to save gas
    uint _maxBalance;
    uint _initialBalance;
    uint _exchange;
    uint _annualTax;
    uint _idleTax;
    int8 _maxDistancePoint;
    mapping(address => int8) roundedLongs;
    mapping(address => int8) roundedLats;
    mapping(address => uint) taxedAmounts;
    mapping(address => uint) lastTransactionDates;
    mapping(address => uint) lastTaxedDates;
    mapping(bytes => uint) promises;
    mapping(address => uint) balances;
    mapping(address => uint) allowed;
    event MintingDisabled();
    event Minted(address indexed _to, uint _value);
    event Minced(address indexed _from, uint _value);
    event AnnualTaxDeducted(address indexed _to, uint _value);
    event IdleTaxDeducted(address indexed _to, uint _value);
    event Donated(address indexed _from, uint _value);

    // ------------------------------------------------------------------------
    // Constructor
    // ------------------------------------------------------------------------
    constructor() public {
        symbol = "HUJO";
        name = "A community skills exchange token";
        mintable = true;
        _maxBalance = 20; //Tokens
        _initialBalance = 10; // Tokens
        _annualTax = 5;
        _idleTax = 1; //monthly
        _exchange = 750000000000000; //Wei - Initial exchange = 0.00075 Eth ~ 25 cents CDN
        _maxDistancePoint = 4; //~100km
    }


    function setMaxBalance(uint balance) onlyOwner external returns (bool success) {
    	_maxBalance = balance;
    	return true;
    }


    function setInitialBalance(uint balance) onlyOwner external returns (bool success) {
    	_initialBalance = balance;
    	return true;
    }


    function setAnnualTax(uint tax) onlyOwner external returns (bool success) {
    	_annualTax = tax;
    	return true;
    }


    function setIdleTax(uint tax) onlyOwner external returns (bool success) {
    	_idleTax = tax;
    	return true;
    }


    function setMaxDistancePoint(int8 distancePoint) onlyOwner external returns (bool success) {
    	_maxDistancePoint = distancePoint;
    	return true;
    }


    //update the exchange rate
    function setExchange(uint exchange) onlyOwner external returns (bool success) {
    	_exchange = exchange;
    	return true;
    }


    function disableMinting() onlyOwner external returns (bool success) {
    	require(mintable);
    	mintable = false;
    	emit MintingDisabled();
    	return true;
    }


    /**
     * - Entry point for new account
     * - Amount must equal initialBalance
     */    
    function mintEnrol(int8 roundedLong, int8 roundedLat) external payable returns (bool success) {
    	require(mintable);
    	require(
    		msg.value > 0 && msg.value % _exchange == 0, 
			"Insufficient fund or not Exact change"
		);
    	uint tokens = msg.value / _exchange; 
    	require(
    		lastTransactionDates[msg.sender] == 0 && tokens == _initialBalance, 
			"Incorrect fund. See enrolCost"
		); 

    	owner.transfer(msg.value);

    	//TODO can these combined into one int8?
    	//TODO can these be uint8? eg if > 1000 then treat as -ve? but will need conversion? conversion is expensive too.
    	roundedLongs[msg.sender] = roundedLong;
    	roundedLats[msg.sender] = roundedLat;

    	lastTransactionDates[msg.sender] = lastTaxedDates[msg.sender] = now;
    	taxedAmounts[msg.sender] = 0;

    	//Pre approve to max balance
    	approve(msg.sender, _maxBalance);

    	balances[msg.sender] += tokens;

    	emit Minted(msg.sender, tokens);

    	return true;
    }


    /**
     * - Can mint the taxed amount or less
     * - For existing user only
     */
    function mint() external payable returns (bool success) {
    	require(mintable);
    	require(
    		msg.value > 0 && msg.value % _exchange == 0, 
			"Insufficient fund or not Exact change"
		);
    	uint tokens = msg.value / _exchange; 
    	require(
			lastTransactionDates[msg.sender] > 0 && tokens <= taxedAmounts[msg.sender],
			"Incorrect fund. Must = taxed() x exchange wei"
		); 

    	owner.transfer(msg.value);

    	lastTransactionDates[msg.sender] = lastTaxedDates[msg.sender] = now;
    	taxedAmounts[msg.sender] = 0;

    	balances[msg.sender] += tokens;

    	emit Minted(msg.sender, tokens);

    	return true;
    }


    /**
     * Returns wei required to join 
     */
    function enrolCost() external view returns (uint amount) {
    	return _initialBalance * _exchange;
    }


    /**
     * Returns wei of currently taxed 
     */
    function topupCost() external view returns (uint amount) {
    	return taxedAmounts[msg.sender] * _exchange;
    }


    /**
     * Returns exchange rate
     */
    function exchangeRate() external view returns (uint amount) {
    	return _exchange;
    }


    /**
     * For extremem cases, owner can mint any amount of tokens to a user
     */
    function mintAny(address to, uint tokens) onlyOwner public returns (bool success) {
    	balances[to] += tokens;
    	emit Minted(to, tokens);
        return true;
    }


    /**
     * Opposite of mintAny - destroy any amount of tokens from a user
     */
    function minceAny(address from, uint tokens) onlyOwner public returns (bool success) {
    	balances[from] -= tokens;
    	emit Minted(from, tokens);
        return true;
    }


    function tax(address taxPayer, uint tokens) internal returns (bool success) {
    	taxedAmounts[taxPayer] += tokens;
        balances[taxPayer] -= tokens;
        return true;
    }


    /**
     * AKA system fee 
     */
    function annualTax(address taxPayer) public returns (bool success) {
    	if (lastTaxedDates[taxPayer] == 0) {
    	    return true;
    	} 

    	uint numYrPass = (now - lastTaxedDates[taxPayer]) / (365 days);
    	if (numYrPass > 0) {
    		uint taxAmount = _annualTax * numYrPass;
    		if (taxAmount > balances[taxPayer]) {
    			taxAmount = balances[taxPayer];
    		}
    		tax(taxPayer, taxAmount);
        	lastTaxedDates[taxPayer] = lastTaxedDates[taxPayer] + (365 days) * numYrPass;
        	emit AnnualTaxDeducted(taxPayer, taxAmount);	
    	}

    	return true;
    }


    function idleTax(address taxPayer) public returns (bool success) {
    	uint monthsIdled = (now - lastTransactionDates[taxPayer]) / 30 days;
    	if (monthsIdled > 0) {
    		tax(taxPayer, monthsIdled * _idleTax);
    		lastTransactionDates[taxPayer] = now;
    	}
    	emit IdleTaxDeducted(taxPayer, monthsIdled * _idleTax);
    	return true;
    }


    function taxed() external view returns (uint tokens) {
    	return taxedAmounts[msg.sender];
    }


    // ------------------------------------------------------------------------
    // Total supply
    // ------------------------------------------------------------------------
    function totalSupply() public override view returns (uint) {
        //return _totalSupply.sub(balances[address(0)]);
    	return 0;
    }


    // ------------------------------------------------------------------------
    // Get the token balance for account `tokenOwner`
    // ------------------------------------------------------------------------
    function balanceOf(address tokenOwner) public override view returns (uint balance) {
    	return balances[tokenOwner];
    }


    function getLastTransactionDate() external view returns (uint lastTransactionDate) {
    	return lastTransactionDates[msg.sender];
    }


    function getLastTaxedDate() external view returns (uint lastTaxedDate) {
    	return lastTaxedDates[msg.sender];
    }


    // ------------------------------------------------------------------------
    // Transfer the balance from token owner's account to `to` account
    // - Owner's account must have sufficient balance to transfer
    // - 0 value transfers are allowed
    // ------------------------------------------------------------------------
    function transfer(address to, uint tokens) public override returns (bool success) {
    	revert('Not allowed');
    	//return true;

    	//balances[msg.sender] = balances[msg.sender].sub(tokens);
        //balances[to] = balances[to].add(tokens);
        //emit Transfer(msg.sender, to, tokens);
        //return true;
    }


    /**
     * Called only once when account initiated
     */
    // ------------------------------------------------------------------------
    // Token owner can approve for `spender` to transferFrom(...) `tokens`
    // from the token owner's account
    //
    // https://github.com/ethereum/EIPs/blob/master/EIPS/eip-20-token-standard.md
    // recommends that there are no checks for the approval double-spend attack
    // as this should be implemented in user interfaces
    // ------------------------------------------------------------------------
    function approve(address spender, uint tokens) public override returns (bool success) {
    	//TODO disregard receiver and change approveAndCall

    	allowed[msg.sender] = tokens;
        emit Approval(msg.sender, spender, tokens);
        return true;
    }


    // ------------------------------------------------------------------------
    // Sender promises to transfer `tokens` from the `from` account to the `to` account
    // Balance are essentially held on contract until transferFrom() is called
    // or promiseCancel() is called.
    //
    // This is differs from ERC20's approve() as this is a mechanism 
    // acting as a trust to ensure payer has sufficient fund to pay at a later time 
    //
    // The calling account must have sufficient tokens in balance
    // - Sender must have sufficient balance to promise for transfer
    // - 0 value transfers are allowed
    // ------------------------------------------------------------------------
    function promiseTo(address to, uint tokens) public returns (bool success) {
    	require(allowed[msg.sender] >= tokens, "Not approved");
    	require(balances[to] + tokens <= _maxBalance, "Reciever over-balanced");
    	require(roundedLongs[msg.sender] != 0, "Sender not registered");
    	require(roundedLongs[to] != 0, "Receiver not registered");
    	//Taken from https://stackoverflow.com/questions/6548940/sql-distance-query-without-trigonometry
    	require(
			(
				(roundedLats[msg.sender] - roundedLats[to]) * 
				(roundedLats[msg.sender] - roundedLats[to]) + 
				((roundedLongs[msg.sender] - roundedLongs[to]) * 2) * 
				((roundedLongs[msg.sender] - roundedLongs[to]) * 2)
			) < _maxDistancePoint,
			"Receiver too far"
		);
    	annualTax(msg.sender);
    	idleTax(msg.sender);
    	//TODO Is this necessary rather than using safeMath for tax not to be reverted
    	//assert(balances[from] - tokens > 0, "Not sufficient fund");

    	balances[msg.sender] = balances[msg.sender].sub(tokens);
    	bytes memory addressesHash = abi.encode(msg.sender, to);
    	promises[addressesHash] = promises[addressesHash].add(tokens);
        return true;
    }


    // ------------------------------------------------------------------------
    // Returns True when tokens is within promised 
    // ------------------------------------------------------------------------
    function hasPromise(address to, uint tokens) public view returns (bool success) {
    	return promises[abi.encode(msg.sender, to)] >= tokens;
    }


    // ------------------------------------------------------------------------
    // Returns the number of tokens 'from' promised to 'to'  
    // ------------------------------------------------------------------------
    function promisedTo(address to) public view returns (uint tokens) {
    	return promises[abi.encode(msg.sender, to)];
    }


    // ------------------------------------------------------------------------
    // Sender releases a promise by payer to transfer tokens
    // All values must equal originally promised for confirmation.
    // ------------------------------------------------------------------------
    function releasePromise(address from, uint tokens) public returns (bool success) {
    	promises[abi.encode(from, msg.sender)].sub(tokens);
    	return true;
    }


    // ------------------------------------------------------------------------
    // Transfer `tokens` from the `from` account to the `to` account
    // All values must agree with record in the Promise for confirmation.
    // Also behaviour deviates from that intended in ERC20 in that 
    // it only allows sender (from) to call
    // ------------------------------------------------------------------------
    function transferFrom(address from, address to, uint tokens) public override returns (bool success) {
    	require(msg.sender == from, "Sender is not 'from'");
    	bytes memory addressesHash = abi.encode(from, to);
    	promises[addressesHash] = promises[addressesHash].sub(tokens);
        balances[to] = balances[to].add(tokens);
        emit Transfer(from, to, tokens);
        return true;
    }


    // ------------------------------------------------------------------------
    // Returns the amount of tokens approved by the owner that can be
    // transferred to the spender's account
    // ------------------------------------------------------------------------
    function allowance(address tokenOwner, address spender) public override view returns (uint remaining) {
    	return allowed[tokenOwner];
    }


    // ------------------------------------------------------------------------
    // Donation to owner
    // ------------------------------------------------------------------------
    function donate() external payable {
    	owner.transfer(msg.value);
    	emit Donated(msg.sender, msg.value);
    }   

    fallback() external {
    	revert('Function not found');
    }
}
